import unittest


# https://leetcode.com/problems/is-subsequence

class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        positions = {}
        for i in range(len(t)):
            indexes = positions.get(t[i], list())
            indexes.append(i)
            positions[t[i]] = indexes

        if len(s) == 1 and s[0] not in positions:
            return False

        min_start_position = -1

        for j in range(len(s) - 1):
            if s[j] not in positions or s[j + 1] not in positions:
                return False
            start_positions = positions[s[j]]
            next_positions = positions[s[j + 1]]
            found_next = False
            for start_position in start_positions:
                if found_next:
                    break
                if start_position < min_start_position:
                    continue
                for next_position in next_positions:
                    if next_position > start_position:
                        min_start_position = next_position
                        found_next = True
                        break
            if not found_next:
                return False
        return True


class TestStringMethods(unittest.TestCase):
    def test_a(self):
        self.assertEqual(True, Solution().isSubsequence("abc", "ahbgdc"))

    def test_b(self):
        self.assertEqual(True, Solution().isSubsequence("leetcode",
                                                        ""))


if __name__ == "__main__":
    unittest.main()
